script: |
  super -f text -I q9066.spq | sort > q9066.out

inputs:
  - name: q9066.spq
    data: |
      SELECT ALL - col2 * + col2 + + 45 * col2 FROM tab1 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN CAST ( col0 AS INTEGER ) * - 56 + 43 AND NULL;
  - name: tab1

outputs:
  - name: q9066.out
    data: |
